import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M8 12a4 4 0 100-8 4 4 0 000 8z", fill: primaryFill }),
        React.createElement("path", { d: "M8 1a7 7 0 100 14A7 7 0 008 1zM2 8a6 6 0 1112 0A6 6 0 012 8z", fill: primaryFill }));
};
const Record16Regular = wrapIcon(rawSvg({}), 'Record16Regular');
export default Record16Regular;
